import * as progress from "@ibrains-design/progress"
import { normalizeProps, useMachine } from "@ibrains-design/solid"
import { createMemo, createUniqueId } from "solid-js"

function Progress() {
  const [state, send] = useMachine(progress.machine({ id: useId() }))

  const api = createMemo(() => progress.connect(state, send, normalizeProps))

  return (
    <div {...api().getRootProps()}>
      <div {...api().getLabelProps()}>Upload progress</div>
      <div {...api().getTrackProps()}>
        <div {...api().getRangeProps()} />
      </div>
    </div>
  )
}
